def max_buckets(grid, capacity):
    n = len(grid)
    m = len(grid[0])
    dp = [[0]*m for _ in range(n)]
    for i in range(n):
        for j in range(m):
            if grid[i][j] == 1:
                dp[i][j] = 1
            else:
                if i > 0:
                    dp[i][j] = min(dp[i][j], dp[i-1][j] + 1)
                if j > 0:
                    dp[i][j] = min(dp[i][j], dp[i][j-1] + 1)
    return sum(sum(row) for row in dp)

def min_buckets(grid, capacity):
    n = len(grid)
    m = len(grid[0])
    dp = [[0]*m for _ in range(n)]
    for i in range(n-1, -1, -1):
        for j in range(m-1, -1, -1):
            if grid[i][j] == 0:
                dp[i][j] = 1
            else:
                dp[i][j] = min(dp[i+1][j] + 1 if i+1 < n else float('inf'), dp[i][j+1] + 1 if j+1 < m else float('inf'))
